  description: |-
    ## About
    NEC Storage Plug-in for Containers (NSPC) is a plugin that integrates NEC Storage V Series into Kubernetes based clusters.
    NSPC provides dynamic persistent volume provisioning capabilities from NEC Storage V Series arrays.

    For full documentation, refer to the reference guide.

    ## Requirements

    ### Supported Driver Version

    * NSPC v3.9.0

    ### Supported Platforms

    * OpenShift v4.7, v4.8, v4.9

    ### Supported Operating Systems

    * RHEL 7.x
    * RHEL 8.x
